import React, {Component} from 'react';

class Jumbotron extends Component {
  render() {
    return (
      <div className='JumboBack'>
      <div className='JumboText'>
      <a href='http://highoncoding.com/Articles/881_The_Curse_of_the_Current_Reviews.aspx'><h1 id='JumboTitle'>Curse of the Current Reviews</h1></a>
      <p id='JumboBody'>When you want to buy an application from the Apple iTunes store you have more choices than you can handle. Most of the users scroll past the application description completely avoiding it like ads displayed on the right column of your webpage. Their choice is dependent on three important factors price, screenshot, and reviews.</p>
      </div>
      </div>
    )
  }
}

export default Jumbotron
